import React from 'react';

class App extends React.Component{
  state= {users:[]}
  componentDidMount() {
    fetch('/users')
    .then(res=> res.json())
    .then(users => this.setState({users}));
  }

  render(){
    return (
      <div>
        <ul>
          {this.state.users.map(user => 
          <li key={user.id}>
            {user.username}
          </li>)}
        </ul>
      </div>
    );
  }
}

export default App;

